import React, { Component } from 'react';
import { NavLink } 			from 'react-router-dom';

import styled 				from 'styled-components';

import { Butt } 			from '../styles/Butt';
import { CrNv } 			from '../styles/CrNv';
import { FaAlignRight} 		from 'react-icons/fa'
import { infoData }         from "../data/infoData";

export default class NaviProject extends Component {
	render() {
		{/*
        https://www.iconfinder.com/icons/10496/poll_icon */}

  		state = {
    		infoDatas: infoData
  		};

		return (
			<section>
				<div className="nav-project"></div>	        
		          <div className="container">
		           <div className="row">
		          	<div className="col-10 mx-auto col-md-6 mt-2"> 

					  <CrNv className="navbar navbar-expand-sm px-sm-5">
						<ul className="navbar-nav mx-auto align-items-center">
		            	  {this.state.infoDatas.map((item, index) => {
		              		return (	              		
		              		  <li key={index} className="nav-item">
								<article key={index} className="portfolio">
					  	    		<span className="icon-portfolio">{item.icon}</span>
					  	    		<h6 className="icon-portfolio">{item.titl}</h6>
					  	    		<NavLink exact to="/{item.titl}" className="nav-link" activeClassName="nav-active">
										{item.titl}
									</NavLink>
			  	    			</article>
		              		  </li>
		              		);
		            	  })}
		                </ul>
					  </CrNv>

				    </div>
				  </div> 
				 </div>
			</section>
		);
	}
}
